import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import Login from "./Login";
import DashBoard from "./DashBoard";
import Signup from "./Signup";
import "./App.css";
import AgencyLogin from "./AgencyLogin";     // Renamed from OwnerLogin
import AgencySignup from "./AgencySignup";   // Renamed from OwnerSignup
import AgencyDashboard from "./AgencyDashboard"; // Renamed from OwnerDashboard

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/login" element={<Login />} />
          <Route path="/signup" element={<Signup />} />
          <Route path="/dashboard/*" element={<DashBoard />} />
          <Route path="/agencylogin" element={<AgencyLogin />} />    // Updated path
          <Route path="/agencysignup" element={<AgencySignup />} />  // Updated path
          <Route path="/agency-dashboard" element={<AgencyDashboard />} /> // Updated path
        </Routes>
      </div>
    </Router>
  );
}

function Home() {
  return (
    <div>
      <div className="hero-section">
        <div className="overlay">
          <h1 className="logo">Wander More, Worry Less</h1>
          <h2 className="tagline">Discover the best places in INDIA</h2>
          <div className="menu-links">
            <Link to="/login" className="login-button">Log in</Link>
            <Link to="/signup" className="signup-button">Sign up</Link>
            <Link to="/agencylogin" className="owner-button">Agency</Link> {/* Updated Link */}
          </div>
        </div>
      </div>
      <div className="card-section">
        <div className="card">
          <img src="https://www.orfonline.org/public/uploads/seo/20240618161721.png" alt="Buses" />
          <h3>Buses</h3>
        </div>
        <div className="card">
          <img src="https://www.tamilnadutourism.tn.gov.in/img/pages/medium-desktop/take-a-ride-in-the-toy-train-1653978188_8ac904b5bdb228abad78.webp" alt="Trains" />
          <h3>Trains</h3>
        </div>
        <div className="card">
          <img src="https://aviationworld.in/wp-content/uploads/2024/07/AS-SA-Flight.jpg" alt="Flights" />
          <h3>Flights</h3>
        </div>
      </div>
    </div>
  );
}

export default App;
